INSERT INTO `b_thing` VALUES (94, '广州长隆景区', '60041309-e2ab-48fe-8a0b-56eaec165af9.jpeg', '景区内山清水秀，绿树成荫，是一处天然的休闲胜地。悠闲的散步道、清澈见底的湖泊、五彩斑斓的花海，让游客仿佛置身于仙境之中。此外，景区内还保留着许多古老的建筑和文化遗迹，如古城墙、古庙宇、古村落等，让游客感受到古代文明的魅力。\r\n\r\n除了自然景观和人文景点，景区内还设有多个现代化的娱乐设施和活动，如游乐园、水上乐园、SPA中心等，适合各个年龄段的游客前来游玩。此外，景区还定期举办各类文化活动、艺术展览等，为游客提供了更丰富多彩的体验。\r\n\r\n景区是一处集自然、人文、娱乐于一体的理想旅游胜地，无论是家庭出游、情侣约会还是朋友聚会，都能在这里找到适合自己的乐趣和快乐。欢迎广大游客前来XXXX景区，共同探索这片美丽的土地。', '220', '0', 0, '周一到周五', 433, '3A级', '广州郊区', '1686408371137', 3, 6, 0, 0, 0, 2, NULL);
